import React from 'react'

function Rating(value, text) {
  return (
    <div className="rating text-amber-400">
        <span>
            <i className={
                value >= 1 
                    ? 'fa-solid fa-star' 
                    : value >= 0.5 
                        ? 'fa-solid fa-star-half-stroke'
                        : 'fa-regular fa-star'    
            }>
            </i>
        </span> 
    </div>
  )
}

export default Rating
